import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Breadcrumbs from "@material-ui/core/Breadcrumbs";
import Typography from "@material-ui/core/Typography";
import Link from "@material-ui/core/Link";
import NavigateNextIcon from "@material-ui/icons/NavigateNext";

const useStyles = makeStyles(theme => ({
  root: {
    justifyContent: "center",
    flexWrap: "wrap"
  },
  paper: {
    padding: theme.spacing(1, 2),
    padding: '10px 30px',
    position: 'relative',
    background: '#3b4f6326'
  }
}));

function handleClick(event) {
  event.preventDefault();
  alert("You clicked a breadcrumb.");
}

export default function CustomSeparator(props) {
  const classes = useStyles();

  //if(props.query.catindex){
  const category = props.categories.find(
    e => e.catindex === props.post.catindex
  );
  //  }
  //if(props.query.keyindex){
  const subcat = props.categories.find(
    e => e.keyindex === props.post.keyindex
  );
  //   }

  return (
    <div className={classes.root}>
      <Paper elevation={0} className={classes.paper}>
        <Breadcrumbs
          separator={<NavigateNextIcon fontSize="small" />}
          aria-label="breadcrumb"
        >
          <Link color="inherit" href="/">
            Home
          </Link>

            <Link color="inherit" href="/posts">
              All Posts
            </Link>



            <Link color="inherit" href={`/posts/${props.post.catindex}`}>
              {category.maincategory}
            </Link>

            <Link color="inherit" href={`/posts/${props.post.catindex}/${props.post.keyindex}`}>
              {subcat.subcategory}
            </Link>


            <Typography color="textPrimary">Post {props.post.id}</Typography>

        </Breadcrumbs>
      </Paper>
    </div>
  );
}
